private AppLogs getAndSetActiveLog(ApplicationId appId, Path appDirPath) {
  AppLogs appLogs = appIdLogMap.get(appId);
  if (appLogs == null) {
    appLogs = createAndPutAppLogsIfAbsent(appId, appDirPath, AppState.ACTIVE);
  }
  return appLogs;
}
